import React, { useState } from "react";
import { Route, Link, Switch, BrowserRouter as Router, BrowserRouter } from "react-router-dom";
// import  useNavigate  from "react-router-dom/";
// import { createUserWithEmailAndPassword, updateProfile } from "firebase/auth";
import {
  MDBBtn,
  MDBContainer,  
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBInput,
  MDBIcon,
  MDBCheckbox
}

from 'mdb-react-ui-kit';

import { auth } from "../../firebae";
import { createUserWithEmailAndPassword, updateProfile } from "firebase/auth";

import Login from "./login";
import {Redirect} from "react-router-dom";

function Register() {
// const redirect = Redirect();
  
  const [values, setValues] = useState({
      name: "",
      empid: "",
      email: "",
      pass: "",
    });

    const [errorMsg, setErrorMsg] = useState("");
    const [submitButtonDisabled, setSubmitButtonDisabled] = useState(false);
    const handleJustifyClick = () => {
      if (!values.name || !values.email || !values.email || !values.pass) {
        setErrorMsg("Fill all fields");
        return;
      }
      setErrorMsg("");
      console.log(values);
      createUserWithEmailAndPassword(auth, values.email, values.pass).then(async(res)=>{
        setSubmitButtonDisabled(false);
        const user = res.user;
        await updateProfile(user, {
          displayName: values.name,
        });
       
        // navigate("/");
       Redirect("/");
 
        console.log(user);
      })
      .catch((err) => {
        setSubmitButtonDisabled(false);
        setErrorMsg(err.message);

      })

    }

 
  
  return (
    <div className='Register' style={{margin:200}}>
    <MDBContainer fluid>

      <MDBCard className='text-black m-5' style={{borderRadius: '25px'}}>
        <MDBCardBody>
          <MDBRow>
            <MDBCol md='10' lg='6' className='order-2 order-lg-1 d-flex flex-column align-items-center'>

              <p className="text-center h1 fw-bold mb-5 mx-1 mx-md-4 mt-4">Sign up</p>

              <div className="d-flex flex-row align-items-center mb-4 ">
                <MDBIcon fas icon="user me-3" size='lg'/>
                <MDBInput label='Your Name' id='form1' type='text' className='w-100'
                  onChange={(event) =>
                    setValues((prev) => ({ ...prev, name: event.target.value }))
                  }
                
                />
              </div>

              <div className="d-flex flex-row align-items-center mb-4">
                <MDBIcon fas icon="lock me-3" size='lg'/>
                <MDBInput label='Emp id' id='form2' type='text'
                  onChange={(event) =>
                    setValues((prev) => ({ ...prev, empid: event.target.value }))
                  }
                />
              </div>

              <div className="d-flex flex-row align-items-center mb-4">
                <MDBIcon fas icon="envelope  me-3" size='lg'/>
                <MDBInput label='email' id='form3' type='email'
                  onChange={(event) =>
                    setValues((prev) => ({ ...prev, email: event.target.value }))
                  }
                />
              </div>

              <div className="d-flex flex-row align-items-center mb-4">
                <MDBIcon fas icon="key me-3" size='lg'/>
                <MDBInput label=' password' id='form4' type='password'
                  onChange={(event) =>
                    setValues((prev) => ({ ...prev, pass: event.target.value }))
                  }
                />
              </div>

              <div className='mb-4'>
                <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label='Subscribe to our newsletter' />
              </div>
             < b className="primary">{errorMsg}</b>

              <MDBBtn  className='mb-4' size='lg' type="submit" to ="/login" onClick={handleJustifyClick}>  Register </MDBBtn>

            </MDBCol>

            <MDBCol md='10' lg='6' className='order-1 order-lg-2 d-flex align-items-center'>
              <MDBCardImage src='https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-registration/draw1.webp' fluid/>
            </MDBCol>

          </MDBRow>
        </MDBCardBody>
      </MDBCard>

    </MDBContainer>
    </div>
  );
}

export default Register;
